import axios from 'axios'

export function getData() {
  let home = process.env.REACT_APP_URL_HOME
  let features = process.env.REACT_APP_URL_FEATURES
  let about = process.env.REACT_APP_URL_ABOUT
  let footer = process.env.REACT_APP_URL_FOOTER
  let product = process.env.REACT_APP_URL_PRODUCT
  let header = process.env.REACT_APP_URL_HEADER

  let header_data={
    headers: {
      api_key: process.env.REACT_APP_API_KEY,
      authtoken: process.env.REACT_APP_AUTHTOKEN
    }
  }

  const requestOne = axios.get(home,header_data)
  const requestTwo = axios.get(features,header_data)
  const requestThree = axios.get(about,header_data)

  const requestFour =axios.get(product,header_data)

  const requestFive = axios.get(header,header_data)


  const requestSix = axios.get

  return axios.all([requestOne, requestTwo, requestThree, requestFour, requestFive, requestSix])
    .then(axios.spread((...responses) => {
      const responseOne = responses[0]
      const responseTwo = responses[1]
      const responesThree = responses[2]
      const responesFour = responses[3]
      const responesFive = responses[4]
      const responesSix = responses[5]
      console.log(responesFive)


      // use/access the results 
    })).catch(errors => {
      // react on errors.
    })


}

